function CharacterDetail(props) {
    const getGender = () => {
        if (props.character.gender === 'female') {
            return 'Mujer';
        } else if (props.character.gender === 'male') {
            return 'Hombre';
        }
    }
    return (
        <section className="">

            <img
                className=""
                src={props.character.image}
                alt={`foto de ${props.character.name}`}
                title={`foto de ${props.character.name}`}></img>
            <h4 className="">{props.character.name}</h4>
            <p className="">{props.character.species}</p>
            <p className="">{props.character.lternateNames}</p>
            <p className="">{getGender()}</p>
            <p className="">{props.character.house}</p>
            <p className="">{props.character.alive}</p>


        </section>
    )
};
export default CharacterDetail;
